{"operationName":"blocks","variables":{"timestampFrom":1672339980,"timestampTo":1672340580},"query":"query blocks($timestampFrom: Int!, $timestampTo: Int!) {
  blocks(
    first: 1
    orderBy: timestamp
    orderDirection: asc
    where: {timestamp_gt: $timestampFrom, timestamp_lt: $timestampTo}
  ) {
    id
    number
    timestamp
  }
}
"}

